description:
Wanneer Andy op zomerkamp is, wordt Woody ontvoerd door Al, een fanatieke speelgoedverzamelaar. Hij heeft Woody nodig om zijn collectie compleet te maken en wil hem in een museum achter glas zetten. Onder leiding van Buzz Lightyear komen Meneer Aardappelhoofd, Hamm, Rex en Slinky in actie in een avontuurlijke en hilarische reddingsmissie waar iedereen volop van zal genieten!
